import { GET_STOCK_INFO} from '../actions/types';

initialState = {
    companyInfo:{},
    currentCompany:"AMZN"
}
export default (state = {}, action) => {
  switch (action.type) {
    case GET_STOCK_INFO:
        return { ...action.payload }
    default:
      return state;
  }
};
